import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';

const root = document.getElementById('root');

const rootInstance = ReactDOM.createRoot(root);
rootInstance.render(
  <Router>
    <App />
  </Router>
);
